import React from 'react';
import './SideBar.css';
import { useNavigate } from 'react-router-dom';

const SideBar = ({sidebar}) => {

    const navigate = useNavigate();

    const homeClick = () => {
        navigate('/');
    };

    const aboutClick = () => {
        navigate('/About');
    }

    return (
        <div className={sidebar?"sidebar sidebar--open":"sidebar"}>
            <li onClick={homeClick}><i className="ri-home-line"></i>Home</li>
            <li onClick={aboutClick}><i className="ri-creative-commons-by-fill"></i>Balls</li>
        </div>
    );
};

export default SideBar;
